content.css:
.container {
  overflow: auto;
  height: 100%;
  width: 100%;
}
ul li {
  list-style: disc;
}
ol li {
  list-style: decimal;
}
.mermaid-diagram {
  text-align: center;
}
.github {
  line-height: 1.5;
  word-wrap: break-word;
}
.github > *:first-child {
  margin-top: 0 !important;
}
.github h1,
.github h2,
.github h3,
.github h4,
.github h5,
.github h6 {
  margin-top: 24px;
  margin-bottom: 16px;
  font-weight: 600;
  line-height: 1.25;
}
.github p,
.github blockquote,
.github ul,
.github ol,
.github dl,
.github table,
.github pre,
.github details {
  margin-top: 0;
  margin-bottom: 16px;
}
.github ul,
.github ol {
  padding-left: 2em;
}
.github kbd {
  padding: 3px 5px;
  font: ui-monospace, SFMono-Regular, SF Mono, Menlo, Consolas, Liberation Mono, monospace;
  font-size: 11px;
  color: #1f2328;
  background-color: #f6f8fa;
  border: 1px solid rgba(175, 184, 193, 0.2);
  border-radius: 6px;
  box-shadow: inset 0px -1px 0px 0px rgba(175, 184, 193, 0.2);
}
.github code {
  padding: 0.2em 0.4em;
  margin: 0;
  font: ui-monospace, SFMono-Regular, SF Mono, Menlo, Consolas, Liberation Mono, monospace;
  font-size: 85%;
  white-space: break-spaces;
  background-color: rgba(175, 184, 193, 0.2);
  border-radius: 6px;
}
.github pre {
  padding: 16px;
  border-radius: 6px;
  overflow: auto;
}
.github pre:not(.mermaid-diagram) {
  background-color: #f6f8fa;
}
.github pre code {
  background-color: initial;
}
.github table {
  border-collapse: collapse;
  border-spacing: 0;
  margin-bottom: 16px;
  border: 1px solid rgba(175, 184, 193, 0.2);
  border-radius: 6px;
}
.github table th,
.github table td {
  padding: 6px 13px;
  border: 1px solid rgba(175, 184, 193, 0.2);
}
.github table th {
  font-weight: 600;
}
.github blockquote {
  margin: 0;
  padding: 0 1em;
  color: #6a737d;
  border-left: 0.25em solid #dfe2e5;
}
